local a={}a.Name="Player Spray Indicator"a.Author="Jammie Dodger"SparkWerk:RegisterPlugin(a)if SERVER then util.AddNetworkString("PlayerSprayString")local function b(c)if not c:IsMod()then SparkWerk.LogLine("<Player Sprayed> "..c:Nick())end;net.Start("PlayerSprayString")net.WriteEntity(c)net.WriteVector(c:GetEyeTraceNoCursor().HitPos)net.Broadcast()end;hook.Add("PlayerSpray","SparkWerk.LogSpray",b,HOOK_MONITOR_LOW)hook.Add("PlayerDidSpray_Lua","SparkWerk.LogSpray",b)end;if CLIENT then local d={}net.Receive("PlayerSprayString",function(e,f)d[net.ReadEntity():EntIndex()]=net.ReadVector()end)hook.Add("HUDPaint","SparkWerk.ShowSprayName",function()for g,h in pairs(d)do if h:Distance(LocalPlayer():GetEyeTrace().HitPos)<32 and LocalPlayer():GetPos():Distance(LocalPlayer():GetEyeTrace().HitPos)<200 then local i="Sprayed by:"surface.SetFont("fatplus")local j,k=surface.GetTextSize(i)draw.SimpleText(i,"fatplus",10,ScrH()/2,Color(255,255,255),0,1)draw.SimpleText(Entity(g):IsValid()and Entity(g):Nick()or"Unknown","fatplus",10,ScrH()/2+k+5,Color(255,255,255),0,1)break end end end)end
