rapidas.\n\nIsto NÃO É o original Zombie Survival!\n\n-- Servidores que corram este modo irão disponabilizar CLASSIC MODE no canto inferior esquerdo do ecrã --"LANGUAGE.classic_mode="CLASSIC MODE"LANGUAGE.resist_x="Resistencia: %d%%"LANGUAGE.right_click_to_hammer_nail="Botão direito do mouse para pregar."LANGUAGE.nails_x="Pregos: %d"LANGUAGE.resupply_box="Caixa de resuplimentos"LANGUAGE.purchase_now="Compre agora!"LANGUAGE.integrity_x="Integridade: %d%%"LANGUAGE.empty="VAZIO"LANGUAGE.manual_control="CONTROLO MANUAL"LANGUAGE.arsenal_crate="Caixa de Arsenal"LANGUAGE.exit_destroyed="Os Mortos-Vivos destruíram uma saída!"LANGUAGE.exit_destroyed_only_one_remain_h="Só resta uma! Se é derrubado não há esperança para uma saída!"LANGUAGE.exit_destroyed_only_one_remain_z="Só resta uma!"LANGUAGE.exit_destroyed_x_remain="%d saídas restantes."LANGUAGE.last_exit_destroyed_all_is_lost="Os zombies destruíram a ultima saída."LANGUAGE.last_exit_destroyed_all_is_lost2="Não há esperança para escapar."LANGUAGE.message_beacon_1="Encontraremonos aqui"LANGUAGE.message_beacon_2="Precisamos de defesa aqui"LANGUAGE.message_beacon_3="Precisamos de turretas aqui"LANGUAGE.message_beacon_4="Precisamos de caixas de arsenal aqui"LANGUAGE.message_beacon_5="Precisamos de médicos aqui"LANGUAGE.message_beacon_7="Caixas de Arsenal aqui"LANGUAGE.message_beacon_8="Precisamos de campos-de-força aqui"LANGUAGE.message_beacon_9="Precisamos de explosivos aqui"LANGUAGE.message_beacon_10="Zombies vêm daqui"LANGUAGE.message_beacon_11="Não entrem!!"LANGUAGE.message_beacon_12="Não vá fora"LANGUAGE.message_beacon_13="Defendem esta area"LANGUAGE.message_beacon_14="Defendem este lugar"LANGUAGE.message_beacon_15="Médicos aqui"LANGUAGE.message_beacon_16="Compram da minha caixa"LANGUAGE.message_beacon_17="Barricada aqui"LANGUAGE.message_beacon_18="Não barricam aqui"LANGUAGE.message_beacon_19="Não deixam os zombies entrarem aqui"LANGUAGE.message_beacon_20="Isto vai quebrar"LANGUAGE.message_beacon_21="Este lugar é perigoso!"LANGUAGE.message_beacon_22="Cuidado com o veneno!"LANGUAGE.message_beacon_23="Zombies estão a partir a barricada aqui!"LANGUAGE.message_beacon_24="Zombies estão a vir, construa uma barricada!"LANGUAGE.message_beacon_25="Plano B aqui"LANGUAGE.class_zombie="Zombie"LANGUAGE.class_poison_zombie="Zombie Venenoso"LANGUAGE.class_fast_zombie="Zombie Rápido"LANGUAGE.class_bloated_zombie="Zombie Inchado"LANGUAGE.class_classic_zombie="Zombie Classico"LANGUAGE.class_super_zombie="Super Zombie"LANGUAGE.class_fresh_dead="Morto fresco"LANGUAGE.class_ghoul="Ghoul"LANGUAGE.class_headcrab="Headcrab"LANGUAGE.class_fast_headcrab="Headcrab Rápido"LANGUAGE.class_poison_headcrab="Headcrab Venenoso"LANGUAGE.class_the_tickle_monster="The Tickle Monster"LANGUAGE.class_nightmare="Nightmare"LANGUAGE.class_pukepus="Pukepus"LANGUAGE.class_bonemesh="Bonemesh"LANGUAGE.class_crow="Corvo"LANGUAGE.class_wilowisp="Wil O' Wisp"LANGUAGE.class_zombie_torso="Torso Zombie"LANGUAGE.class_zombie_legs="Zombie Pernas"LANGUAGE.class_wraith="Wraith"LANGUAGE.class_flesh_beast="Carne Besta"LANGUAGE.class_fast_zombie_legs="Zombie Rápido pernas"LANGUAGE.class_chem_zombie="Chem Zombie"LANGUAGE.class_shade="Shade"LANGUAGE.description_zombie="O Zombie básico que é muito duravel e tem garras potentes.\nÉ dificil de ser derrubado, especialmente se não é disparado na cabeça."LANGUAGE.description_poison_zombie="Este zombie mutante não é so extremamente duravel mas tem uma força anormal.\nSeu corpo é extremamente tóxico e irá arrancar e atirar a sua própia carne para longe."LANGUAGE.description_fast_zombie="Este cadáver ossoso é muito mais rápido comparado com os outros zombies.\nEles não são uma ameaça por eles própios, mas podem alcançar uma área perto deles, subindo com as suas garras.\nEles também não têm problema quando caçam humanos fracos com pouca vida."LANGUAGE.description_bloated_zombie="O corpo é constituído por voláteis, qúimicos tóxicos.\nMesmo que eles movem devagar, eles podem levar um pouco mais do que uma batida."LANGUAGE.description_ghoul="Este zombie tem uma carne muito tóxica.\nÉ um pouco fraco comparado com os outros zombies, mas compensa com o seu ataque venenoso.\nSuas garras podem delibirar um humano por um curto periodo de tempo e irá ejectar veneno através dos seus ferimentos, se danificado com dano suficiente."LANGUAGE.description_headcrab="Headcrabs foram a causa da infeção original\nNinguém sabe de onde eles verdadeiramente vieram.\nO seu método de ataque é morder com os seus dentes na sua barriga."LANGUAGE.description_fast_headcrab="O headcrab macho é consideravelmente rápido mas menos carnudo que a fémea.\nDe qualquer maneira, é igualmente chato e mortífero em grupos."LANGUAGE.description_poison_headcrab="Este headcrab está cheio de neurotóxinas.\nUma dentada é suficiente para matar um humano adulto.\nTambém tem a habilidade de guspir uma parte fraca do seu veneno.\nO guspo é mais mortífero se atinge a cabeça da vitima."LANGUAGE.description_the_tickle_monster="Dito para ser o monstro que esconde no teu armário e te puxa da cama.\nOs braços do Tickle Monster são elásticos que o faz extremamente dificil de ser ultrapassado e também o fazem o ideal destruídor de barricadas."LANGUAGE.description_nightmare="Uma extremamente rara mutação dá o Nightmare as suas habilidades.\nMais forte do que qualquer outro zombie em quase qualquer forma, o Nightmare é a força para ser contada.\nUma passada com as suas garras é o suficiente para derrubar a maioria das pessoas."LANGUAGE.description_pukepus="O corpo apodrecído de Puke Pus é compremetido inteiramente com orgãos que são usados para fazer a regeneração de veneno.\nÉ capáz de vomitar galões de vómito infectado que o torna extremamente perigoso."LANGUAGE.description_bonemesh="Desfigurado e mutilado, o Bonemesh é capaz de atirar bombas de sangue.\nCada bomba é compremetida com ossos e carnes que é uma grande ameaça para os Humanos, no entanto é uma refeição deliciosa para os zombies."LANGUAGE.description_crow="Corvos carnivoros são mais do que uma peste do que eles eram antes da infeção.\nEles alimentam-se da carne dos infectados e funcionam como ''carregadores'' para os Mortos-Vivos.\nPorque nunca querias fazer esta classe escondida?\nQual é o teu problema?"LANGUAGE.description_wilowisp="Ás vezes referidos como espíritos dos mortos."LANGUAGE.description_zombie_torso="Tu nem devias estar a ver isto."LANGUAGE.description_zombie_legs="Tu nem devias estar a ver isto."LANGUAGE.description_wraith="Um zombie ou uma aparição?\nNada se sabe muito sobre isso, tirando o facto que usa a sua\núnica habilidade desprevinida e garras afiádas para cortar coisas aos pedaços."LANGUAGE.description_flesh_beast="*pending*"LANGUAGE.description_fast_zombie_legs="Tu nem devias a estar a ver isto."LANGUAGE.description_chem_zombie="O corpo do Chem Zombie é comprometido de volateis, produtos químicos.\nNão tem nenhum meio para atacar, tirando o facto de morrer e com esperança matar o humano mais próximo da sua explosão."LANGUAGE.description_shade="Criando um campo magnético á sua volta, todos os ataques a bala e melee são inúteis contra ele.\nPor alguma razão, Shade é vulneravel á luz brilhante."LANGUAGE.controls_zombie="> PRIMARIO: Garras\n> SECUNDÁRIO: Gritar\n> RECARREGAR: Queixar\n> SPRINT: Fingir morte\n> DISPARO FATAL NAS PERNAS: Reviver / Transformar"LANGUAGE.controls_poison_zombie="> PRIMARIO: Claws\n> SECUNDÁRIO: Atirar carne\n> RELOAD: Gritar"LANGUAGE.controls_fast_zombie="> PRIMARIO: Claws\n> SECUNDÁRIO: Atirar-se / Trepar (próximo da parede)\n> RECARREGAR: Gritar"LANGUAGE.controls_bloated_zombie="> PRIMARIO: Claws\n> SECUNDÁRIO: Queixar\n> SPRINT: Fingir morte\n> NA MORTE: Sangue venenoso"LANGUAGE.controls_ghoul="> PRIMARIO: Garras venenósas\n> SECUNDÁRIO: Atirar carne\n> SPRINT: Fingir morte\n> RECARREGAR: Gritar\n> QUANDO ATINGE HUMANO: Lento\n> ATINGIDO POR HUMANO: Ejeção de veneno"LANGUAGE.controls_headcrab="> PRIMARIO: Ataque estocado\n> RECARREGAR: Cavar"LANGUAGE.controls_fast_headcrab="> PRIMARIO: Ataque estocado"LANGUAGE.controls_poison_headcrab="> PRIMARIO: Ataque estocado\n> SECUNDÁRIO: Guspir Veneno\n> QUANDO ATINGE HUMANO: Veneno mortífero\n> QUANDO ATINGE NOS OLHOS: Cegueira\n> RECARREGAR: Gritar"LANGUAGE.controls_the_tickle_monster="> PRIMARIO: Garras elásticas\n> SECUNDÁRIO: Queixar"LANGUAGE.controls_nightmare="> PRIMARIO: Toque mortífero\n> SECONDARY: Queixar"LANGUAGE.controls_pukepus="> PRIMARIO: Vómito"LANGUAGE.controls_bonemesh="> PRIMARIO: Garras\n> SECUNDÁRIO: Atira bomba de sangue"LANGUAGE.controls_wraith="> PRIMARIO: Garras\n> SECUNDÁRIO: Gritar\n> INVISIBILIDADE BASEADA NO MOVIMENTO E DISTANCIA"LANGUAGE.controls_flesh_beast="> PRIMARIO: Garras\n> SECUNDÁRIO: Batida com cabeça"LANGUAGE.controls_chem_zombie="> NA MORTE: Bomba Venenosa"LANGUAGE.controls_shade="> PRIMARIO: Subir\n> SECUNDÁRIO: Atirar"LANGUAGE.help_cat_introduction="Introdução"LANGUAGE.help_cat_survival="Sobrevivência"LANGUAGE.help_cat_barricading="Barricagem"LANGUAGE.help_cat_upgrades="Upgrades"LANGUAGE.help_cat_being_a_zombie="Sendo um Zombie"LANGUAGE.help_cont_introduction=[[<p>	Bem vindo ao Zombie Survival, o simulador de sobrevivência (zombie). Zombie Survival te deixa lutar contra ataques zombies, criar barricadas, e até ser parte da horda dos zombies.</p>

<p>Há duas equipas: Os Sobreviventes e os Zombies. Os Humanos ganham se sobrevivem todas as ondas. Alguns niveis têm objectivos a ser completados, que podem ser opcionais ou necessários para ganhar.
Se um Humano é morto ele irá ser zombie, que faz mais dificil ter mais Humanos.</p>

<p>O objectivo dos zombies é matar todos os Humanos, fazendo eles todos zombies e causar a toda gente a derrota da ronda.
Alternativamente, um zombie pode matar quatro humanos para ser resgatado. Isto os deixa com uma segunda chance á sobrevivencia e victória.
Lembra que, o único caminho para ganhar é ser humano quando a ronda acaba. Os Zombies não podem ganhar a ronda técnicamente; zombies só podem fazer todos os outros perderem!</p>

<p>Uma certa quantidade de pessoas são escolhidas ao acaso (ou voluntareadas) para serem os zombies iníciais. Esta quantidade está disponabilizada no fundo do teu ecrã, antes que uma ronda comece.</p>

<p><b>Use os botões em cima para obter ajuda sobre coisas mais específicas.</b></p>

<p>Dicas para esta seção:
<ul><li>Se tu saíres do jogo como Humano, iras vir de volta como Zombie.</li>
<li>Até ao início da onda 3 quem juntará ao jogo irá ser selecionado como zombie, mesmo os novos jogadores irão ser selecionados como zombies.</li>
<li>Use o CHAT DE EQUIPA quando necessário. A tecla normal é U e te permite escrever SÓ para a tua equipa.</li>
</ul></p>
]]LANGUAGE.help_cont_survival=[[<p>Dicas para esta seção:
<ul><li>Carregando a tecla ZOOM (default: Z) deixa-te mover livremente nas barricadas, enquanto caminhas muito lentamente.</li>
<li>Durante a Intermissão tu podes comprar mais items em uma Caixa de Arsenal porque irá aparecer um desconto, mas também podes descobrir items por comaradas mortos.</li>
<li>Se um Humano for directamente morto por um Zombie, ele irá levantar-se. Acaba com a sua miséria antes que ele te ponha a miséria.</li>
<li>É dado a ti algum worth para ser gastado no Worth Menu antes que a ronda comece, gasta tudo mas com cuidado!</li>
<li>Tu podes criar, carregar eliminar e editar carregamentos no começo da ronda, apertando F2. Isto salva muito tempo que pode ser usado para pensar em planos e o que irás fazer na ronda.</li>
<li>Um lugar que sente-se salvo em um momento pode tornar em uma morgue com um ou mais tipos diferentes de zombies á volta.Sempre pensa em um Plano B se as coisas ficarem feias.</li>
<li>Tu és inutil á tua equipa se não estas a fazer alguma coisa que ajude. Tu estás sendo ainda mais inutil se não salvares pontos para comprar uma arma grande!</li>
<li>Carregando a tua tecla SPRINT em objectos especiais, irás empacotar e podem ser utilizados em diversos sítios.</li>
<li>Turretas sem donos (luz azul) podem ser tuas se apertares a tecla USE nelas. Turretas sem donos não irão disparar os zombies!</li>
<li>Objectos que não estão pregados a alguma coisa são inuteis, a não se que sejam EXTREMAMENTE pesados.</li>
<li>Com castigo suficiente, as portas podem ser arrancadas.</li>
<li>Os objectos irão ficar mais e mais vermelhos com os danos que são dados, até expludirem.</li>
<li>Zombies podem fazer spawn em cima deles, se não há um Humano a olhar.</li>
<li>Algumas armas corpo-a-corpo têm um maior alcançe do que as garras dos zombies. Use isto como vantagem para defender-te a ti própio ou uma barricada com uma arma melee.</li>
<li>Jogadores da mesma equipa não danificam-se a si própio, e não colidem-se entre si!.</li>
<li>Tenha certeza de usar uma barricada para a tua proteção, as armas têm alcance infinito, mas as garras dos zombies não! (a não ser veneno).</li>
<li>O dano de veneno pode ser curando com o tempo, mas muito veneno irá te fazer morto.</li>
<li>Os membros da tua equipa nem sempre têm razão, tu não és um ovelha, pois não?! Zombies gostam de matar ovelhas.</li>
<li>Zombies podem ver a tua vida, até através de paredes. Corre de volta para um sitio seguro, ou então vais ser caçado pelos zombies.</li>
<li>Não escondas, os zombies podem te ver em qualquer lado, até na imensidão da escuridão.</li>
<li>O Medidor de Horde que tens no fundo do ecrã deixa-te observar a resistencia e força que tens. Combina um ataque com zombies, assim podes acabar com barricadas gigantes!</li>
<li>Se não tens zombies suficientes para acabar com uma barricada, encontra outros Humanos para caçares.</li>
<li>Não dispares os zombies no gás verde!Só irá regenerar a vida dos zombies, assim só gastas a munição!</li>
<li>Os Zombies são resistentes nas pernas, braços e corpo. Dispara para cabeça para mais danos e para prevenir alguns zombies de voltarem a levantar!</li>
<li>Mesmo que os zombies sejam resistentes, se disparares irás o abrandar, isto pode ser util para salvar um colega com pouca vida.</li>
</ul></p>
]]LANGUAGE.help_cont_barricading=[[<p>Barricar é uma parte importantíssima na sobrevivência. Pode parecer que os zombies não são uma ameaça no princípio mas eventualmente eles irão crescer e irão matar a tua equipa em uma questão de segundos.</p>

<p>A melhor escolha para deixar os zombies de fora, é criar uma barricada.</p>

<p>Há umas ferramentas que te ajudam a criar uma barricada. A mais poderosa e conhecida ferramenta é o Nailing Hammer, que é usado para pregar. Isto faz pregar objectos que tem que ser destruídos pelos zombies, antes que danifiquem o objecto.
Posicione o objecto que queiras pregar apertando USE nele. Depois podes apanhar o teu Nailing Hammer e pregar-lo. É uma boa ideia para pregar o suporte a um objeto resistente, como uma parede, em vez de outros adereços.
Lembra, quando um objecto esta pregado, o dano só irá para o prego, e depois para o objecto. Tu só o podes reparar batendo neles com o Hammer, mas vai chegar a altura em que os pregos estão danificados e não irão resistir mais. Tu podes carregar SHIFT para observar todos os pregos e os seus donos.
.</p>

<p>Uma outra ferramenta é a 'Aegis' Barricade Kit.Esta ferramenta é rapida e deixa-te colocar uma barreira de madeira em uma parede ou corredor. Não é necessário objectos. Para usar, tens que posicionar a uma posição valida (Fica vermelho para verde).
Activa essa barreira carregando o botão do lado esquerdo. Roda usando ATAQUE SECUNDÁRIO e RECARREGA. Isso usa barricadas de madeira(boards) como munição! Tu podes apertar SHIFT para re-paquear essa barricada, que poderá ser reutilizada.</p>

<p>Uma outra ferramenta util é a Turreta. Isto dispara balas nos zombies que se mete no seu caminho. Usa munição de SMG. Tu podes encher a turreta com munição apertando USE nela,isso te doará pontos.
Para por uma turreta, posicione no chão até que fique VERDE. Tem que ser numa superfície sólida (SEM OBJECTOS). Rode a turreta com ATAQUE SECUNDÁRIO e RECARREGA. Se não correr bem, paqueia-a apertando SHIFT nela. Lembra, a turreta só dispara zombies que está no seu alcance.</p>

<p>Dicas para esta seção:
<ul>
<li>Tu ganhas 25% bonus de pontos por matar zombies que atacam barricadas!</li>
<li>Use objectos maior para a barricada. Os pregos ganham menos danos e há mais espaço para danificar os zombies.</li>
</ul></p>]]LANGUAGE.help_cont_upgrades=[[<p>Pontos são obtidos por matando zombies, curando comaradas e construir barricadas.
Tu podes trocar pontos no shop na intermissão por um preço mais barato.
Faz as suas compras a Caixa de Arsenal para um desconto incrível!</p>

<p>Dicas para esta seção:
<ul>
<li>Tenta planear. Compra munição extra no Worth Menu para que possas comprar uma pistola cheia de munição.</li>
<li>Tu ainda ganhas pontos por assistências. A maior metade dos pontos vai para o matador, e a menor metade vai para o que danificou.</li>
<li>Worth e Pontos são separados. Gasta toda a tua Worth!</li>
<li>Caixas de Arsenal (Arsneal Crate) são extremamente valorizadas e são um grande alvo para os zombies.</li>
</ul></p>]]LANGUAGE.help_cont_being_a_zombie=[[<p>Dicas para esta seção:
<ul>
<li>Tu tens uma quantidade infinita de vidas, mas os Humanos não. Ataque sem piedade!</li>
<li>O Zombie regular têm a capacidade de durabilidade. O unico caminho para ser morto com certeza é um ou mais disparos certeiros na cabeça. Tu não precisas das tuas pernas.</li>
<li>Zombies podem fazer spawn nos seus colegas se não há Humanos por perto, vê a caveira, se tiver olhos verdes quer dizer que os teus colegas zombies podem fazer spawn em ti!</li>
<li>Com muita prática, podes usar objectos para matar Humanos a uma GRANDE distancia.</li>
<li>Destrua objectos especiais como turretas, Caixas de Arsenal e de resupplementos, isso irá por os Humanos em uma situação complicada.</li>
<li>Com castigo suficiente, as portas podem ser arrancadas..</li>
<li>Mais os objectos são atingidos, mais vermelhos irão ficar.</li>
<li>O Wraith é completamente invisivel se não moveres.</li>
<li>O ataque especial do Zombie Rápido depende quanto tempo estás no ar. O mais no ar estás, maior o dano. Usa as suas garras para combate corpo-a-corpo!</li>
<li>Em adição de ser extremamente poderoso, o Zombie Venenoso pode arrancar carne de si mesmo e atirar ao seu alvo.</li>
<li>O Headcrab Venenoso pode por os Humanos confusos se atingirem na cabeça.</li>
<li>Vá para humanos com pouca vida! Os zombies também são atraídos, então tente ser o primeiro a matar a vitíma!</li>
<li>O Medidor de Horda no fundo do ecrã indica a quantidade de dano que podes resistir, mais zombies, mais resistencia!</li>
<li>Se não tens zombies suficientes para acabar com uma barricada, tenta caçar..hehe.."coleguas de equipa" em outro sítio.</li>
<li>Se uma área está muito escura, pressione o botão de LATERNA para VISÃO NOCTURNA.</li>
</ul></p>
]]
