emember how you got here.","Occasionally, you find it hard to maintain your balance."},ConsumptionMessages={"It's still terrible, but somehow you're starting to appreciate the more subtle tones.","Miserable, but it's quite filling.","Another helping down, but you notice yourself craving even more.","Gross, but for some reason you're relieved there's still more 'tuna'","It feels like you've just... lost something."},MessageColor=Color(252,234,171)},[2]={PulseCheckHints={"Your head is throbbing.","It's hard to remeber the look of your own face.","You can see the visions, can't you?","You feel the full weight of your sins pressing against your soul.","You are overwhelmed by a sense of dread.","Something is watching you, you just know it."},ConsumptionMessages={"You regret that immediately.","Your stomach churns.","Why did you do that? ","You force down yet another helping."},MessageColor=COLOR_YELLOW},[3]={PulseCheckHints={"Yo͢u ͢a̷r̨e u͟nwe͏ll.","I̵t̴ ̵H̸u̶r̵t̵s̴","Any more, and you're going to s̸n̸a̷p̶.̷.","If yo͟u ̛t̴urn ͢back ͟noẃ, ýou ͡might ͠b̡e o͟kay͝.̕"},ConsumptionMessages={"mmm.... tuna","more","><|||v|o> fish","the mercury is what makes it taste so good"},MessageColor=COLOR_RPINK},[4]={PulseCheckHints={"Y̶̯̫̌̃O̵̡̧͉̙̓̆̐̈́Ù̶͈̋͠ ̷̗͈̀A̷͇̣̻͙͘͠R̵̙͓͚̳̓̽̍̉Ë̶̖̞̜́̅ ̷̛̣̬̖͚̽̈I̸̺̳̩̍̿N̸̫̏̈́͊ ̷̰̃̔D̷͍͍̪̬̋̂̊͝Á̴͇̃͝N̸͇̬̾ͅG̴̼̤͘Ě̶̩̟̋́Ŗ̸̬͌͒̅̇","y̵o̵u̷ ̷h̶a̸v̷e̸ ̵m̸e̴r̵c̴u̴r̶y̷ ̴p̷o̶i̵s̷o̴n̴i̵n̵g̷","y̵o̵u̸r̷ ̶m̷i̴n̷d̷ ̴c̶a̵n̴ ̷b̷e̴ ̸h̸e̴a̷l̸e̵d̵,̴ ̵b̸u̶t̸ ̸y̶o̸u̵r̷ ̴s̸o̴u̷l̷ ̵i̵s̴ ̴f̶o̸r̵e̷v̸e̶r̸ ̵t̴a̷i̶n̷t̴e̴d̵","I͘t'̨s ove͡r."},ConsumptionMessages={"...","-","><|||v|o> <3","<o||v||><"},MessageColor=COLOR_PURPLE,Consequences=function(b,c)local d=b:SteamID64().."_tuna_consequences"if timer.Exists(d)then local e=timer.TimeLeft(d)timer.Adjust(d,math.max(1,e-math.random(5,15)))return else timer.Create(d,math.random(30,60*3.5),0,function()if b and b:IsValidLivingHuman()then b:TriggerInsanityEffect(math.huge)timer.Adjust(d,math.random(30,60*4),nil,nil)else timer.Remove(d)end end)end end}}local f=[[

Mercury Poisoning

Mercury poisoning is a type of metal poisoning due to exposure to mercury.
Symptoms depend upon the type, dose, method, and duration of exposure. They
may include muscle weakness, poor coordination, numbness in the hands and feet,
skin rashes, anxiety, memory problems, trouble speaking, trouble hearing, or
trouble seeing. High-level exposure to methylmercury is known as Minamata disease.
Methylmercury exposure in children may result in acrodynia (pink disease) in which
the skin becomes pink and peels. Long-term complications may include kidney problems
and decreased intelligence. The effects of long-term low-dose exposure to
methylmercury are unclear.

Methylmercury is the major source of organic mercury for all individuals.Due to
bioaccumulation it works its way up through the food web and thus biomagnifies,
resulting in high concentrations among populations of some species. Top predatory fish,
such as tuna or swordfish, are usually of greater concern than smaller species. The US
FDA and the EPA advise women of child-bearing age, nursing mothers, and young children
to completely avoid swordfish, shark, king mackerel and tilefish from the Gulf of Mexico,
and to limit consumption of albacore ("white") tuna to no more than 170 g (6 oz) per week,
and of all other fish and shellfish to no more than 340 g (12 oz) per week. A 2006 review
of the risks and benefits of fish consumption found, for adults, the benefits of one to two
servings of fish per week outweigh the risks, even (except for a few fish species) for women
of childbearing age, and that avoidance of fish consumption could result in significant excess
coronary heart disease deaths and suboptimal neural development in children.

