SWEP.Base="weapon_zs_stunbaton"DEFINE_BASECLASS("weapon_zs_stunbaton")SWEP.PrintName="'Mesh' Admin Path Tool"SWEP.Description="Also known as the 'Navmesh Tool'. Allows the user to create, view, navigation meshes for bot AI. Please be careful making changes during live gameplay, and remember all changes are automatically saved."SWEP.ViewModel="models/weapons/c_stunstick.mdl"SWEP.WorldModel="models/weapons/w_stunbaton.mdl"SWEP.UseHands=true;SWEP.NewSlot=6;SWEP.SlotPos=100;SWEP.DrawAmmo=false;SWEP.DrawCrosshair=true;SWEP.Primary.ClipSize=-1;SWEP.Primary.DefaultClip=0;SWEP.Primary.Automatic=false;SWEP.Primary.Ammo=""SWEP.Secondary.ClipSize=-1;SWEP.Secondary.DefaultClip=0;SWEP.Secondary.Automatic=false;SWEP.Secondary.Ammo=""SWEP.Undroppable=true;SWEP.UnGiveable=true;SWEP.Weight=0;SWEP.AllowQualityWeapons=false;SWEP.PermitDismantle=true;SWEP.DismantleScrap=0;SWEP.OnlyCrosshairDot=true;SWEP.HoldType="pistol"function SWEP:Break()if self.Breaking then return end;self.Breaking=true;local a=self:GetOwner()if IsFirstTimePredicted()then sound.Play(")physics/metal/metal_box_break1.wav",a:WorldSpaceCenter(),75,200)end;if not SERVER then return end;a:CenterNotify("The tool snaps in half! Alas, it was too good to be true...")a:ViewPunch(Angle(-50,0,0))timer.Simple(math.random(2,4),function()RollForContraband(a,1,"Got another pack of","Looking back at the crate, you find a hidden compartment!")end)self:Remove()end;function SWEP:PrimaryAttack()if not self.Breaking then self:Break()end end;function SWEP:SecondaryAttack()if not self.Breaking then self:Break()end end;function SWEP:Reload()if not self.Breaking then self:Break()end end
