tch=95},{time=1.2,snd="weapons/foley/light2.ogg",pitch=100},{time=2.9,snd="weapons/foley/light3.ogg",pitch=100}},[ACT_VM_HITKILL]={{time=0,snd="weapons/foley/medium2.ogg"},{time=0.3,snd="weapons/zs_machete/machete_stabby.ogg",pitch=100}}}end;SWEP.CSMuzzleFlashes=false;SWEP.Primary.Sound=Sound("plats/skylift_stop.wav")SWEP.Primary.Delay=0.5;SWEP.Primary.Damage=230;SWEP.RequiredClip=4;SWEP.Primary.ClipSize=1;SWEP.UseCombinedAmmo=true;SWEP.CombinedAmmoHUD=true;SWEP.Primary.Ammo="XBowBolt"SWEP.Primary.ClipMultiplier=2;SWEP.DryFireSound=""GAMEMODE:SetupDefaultClip(SWEP.Primary)SWEP.ConeMax=2;SWEP.ConeMin=0.4;SWEP.HeadshotMultiProj=1.75;SWEP.InspectAnim=ACT_VM_HAULBACK;SWEP.DrawAnim=ACT_VM_DRAW_DEPLOYED;SWEP.PullbackAnim=ACT_VM_PULLBACK_HIGH;SWEP.UndrawAnim=ACT_VM_DEPLOYED_DRYFIRE;SWEP.ArrowDrawSpeed=1.05;SWEP.MaxPierces=4;SWEP.Greatbow=true;function SWEP:EmitFireSound()self:EmitSound(self.Primary.Sound,75,110,0.5,CHAN_WEAPON)self:EmitSound(")weapons/xm1014/xm1014-1.wav",75,190,0.7,CHAN_WEAPON+1)if self.IsInChargeShot then self:EmitSound("weapons/zs_m82/m82_fire1.ogg",75,190,1,CHAN_WEAPON+2)end end;GAMEMODE:AttachCustomWeaponModifier("ArrowDrawSpeed","Arrow Draw Speed",0.05,2)function SWEP:FireArrow(a)a=a or 1;if SERVER then self:ShootBullets(self.Primary.Damage*a,self.Primary.NumShots,self:GetCone())self:TakeAmmo()end;self:EmitFireSound()if self.IsInChargeShot then self:DoConsumeBuildup()self.IsInChargeShot=false end;if CLIENT then util.ScreenShake(EyePos(),0.4,2,0.5,32)end end;function SWEP:PostProjectileModify(b)b.MaxPierces=self.MaxPierces;if self.IsInChargeShot then b.MaxPierces=b.MaxPierces*2;b.Taper=0.9 end end;function SWEP:ProjectilePierceCallback(b,c)if c.PowerShot then return end;if b:IsValidZombie()then self:AddWeaponBuildup(10)end end
