AddCSLuaFile()SWEP.PrintName="Great Knife"SWEP.Description="An enormous culinary knife that excels at cleaving. Attacks with this weapon have a 45 degree arc,".." hitting a large amount of targets with each swing. Uncharged attacks are horizontal, while charged attacks are vertical and get 10% extra range.".." On kill, gain a unique food item that increases your max HP and grows in power with each subsequent kill."SWEP.Base="weapon_zs_basemelee"DEFINE_BASECLASS("weapon_zs_basemelee")if CLIENT then SWEP.ViewModelFOV=72;SWEP.ShowViewModel=false;SWEP.ShowWorldModel=false;SWEP.VMPos=Vector(0,0,-3)SWEP.VMAng=Vector(0,0,-8)SWEP.VElements={["1"]={type="Model",model="models/props/greatknife.mdl",bone="ValveBiped.Bip01_R_Hand",rel="",pos=Vector(3,1,-18),angle=Angle(0,90,80),size=Vector(0.9,0.9,0.9),color=Color(200,200,200,255),surpresslightning=false,skin=0,bodygroup={}}}SWEP.WElements={["1"]={type="Model",model="models/props/greatknife.mdl",bone="ValveBiped.Bip01_R_Hand",rel="",pos=Vector(-1,3,-19),angle=Angle(-5,100,-270),size=Vector(1,1,1),color=Color(200,200,200,255),surpresslightning=false,skin=0,bodygroup={}}}end;SWEP.HoldType="melee2"SWEP.ViewModel="models/weapons/zs/c_greatsword.mdl"SWEP.WorldModel="models/weapons/w_crowbar.mdl"SWEP.UseHands=true;SWEP.MeleeDamage=230;SWEP.MeleeRange=75;SWEP.MeleeSize=3;SWEP.Primary.Delay=1.8;SWEP.SwingTime=0.9;SWEP.SwingRotation=Angle()SWEP.SwingOffset=Vector()SWEP.SwingHoldType="melee"SWEP.BlockRotation=Angle()SWEP.BlockOffset=Vector()SWEP.Stability=WEAPON_STABILITY_VERY_STRONG;SWEP.BlockReduction=WEAPON_BLOCK_REDUCTION_STRONG;SWEP.FireAnimSpeed=1.5;SWEP.StartSwingAnimation=ACT_VM_HAULBACK;SWEP.MissAnim=ACT_VM_PRIMARYATTACK;SWEP.HitAnim=ACT_VM_PRIMARYATTACK;SWEP.BashAnim=ACT_VM_SWINGHIT;SWEP.BashAnimSpeed=1.8;SWEP.BlockAnim=ACT_VM_FIDGET;SWEP.AllowQualityWeapons=true;SWEP.HeavyTimeMulti=0.45;SWEP.HeavyMulti=1.45;SWEP.Cleave=true;SWEP.CleaveTaper=0.81;SWEP.CleaveDmgFloor=0.095;SWEP.WalkSpeed=SPEED_SLOWEST;SWEP.StaminaUsage=0.127;SWEP.Tier=6;SWEP.MeleeKnockBack=175;SWEP.Culinary=true;SWEP.MaxOffal=7;GAMEMODE:AttachWeaponModifier(WEAPON_MODIFIER_MELEE_RANGE,1.5,1)GAMEMODE:AttachWeaponModifier(WEAPON_MODIFIER_MELEE_IMPACT_DELAY,-0.08,1)function SWEP:Initialize()self:AddFireMode("Bash",nil,self.FireModeSound0,function()self.Weight=4 end)self:AddFireMode("Quick Offal",nil,nil,function()self.Weight=9999 end)BaseClass.Initialize(self)end;function SWEP:ArcCleave(a)local b=self:GetOwner()local c={}local d={}local e=0.33;local f=55;f=f*0.5*(a and-1 or 1)local g=7;local h=self:GetMeleeRange()*(a and 1.1 or 1)local i=a and b:GetRight()or b:GetUp()for j=1,g do local k=b:GetAimVector():Angle()k:RotateAroundAxis(i,util.ClampedRemap(j,1,g,-f,f))local l=(1-math.abs(0.5-util.ClampedRemap(j,1,g,0,1)))*e;local m=b:CompensatedPenetratingMeleeTrace(h*l+h*(1-e),self.MeleeSize,nil,k:Forward(),nil,32)for n,o in pairs(m)do if IsValid(o.Entity)and not d[o.Entity]then c[#c+1]=o;d[o.Entity]=true end end end;return c end;function SWEP:Deploy()local p=self:GetFireMode()self.Weight=p==1 and 9999 or 4;return BaseClass.Deploy(self)end;function SWEP:Holster(q)local p=self:GetFireMode()self.Weight=p==1 and IsValid(q)and(q:GetClass()=="weapon_zs_f_offal"or q:GetClass()==self:GetClass())and 9999 or 4;return BaseClass.Holster(self,q)end;function SWEP:OnRemove()local b=self:GetOwner()local r=IsValid(b)and b:GetWeapon("weapon_zs_f_offal")if IsValid(b)and IsValid(r)then r.EatASAP=false end end;function SWEP:SecondaryAttack()local p=self:GetFireMode()if p==1 then local b=self:GetOwner()local s="weapon_zs_f_offal"local r=IsValid(b)and b:GetWeapon(s)if SERVER and IsValid(r)then r.EatASAP=true;b:SelectWeapon(s)end end end;function SWEP:CanBlock()local p=self:GetFireMode()return p==0 end;function SWEP:BeforeSwing(t)local u=self:IsHeavy()local v=function()return self:ArcCleave(u)end;self.CustomCleave=v;self.MissAnim=self:IsHeavy()and ACT_VM_SWINGHARD or ACT_VM_PRIMARYATTACK;return t end;function SWEP:PlaySwingSound()self:EmitSound(")weapons/zs_katana/zs_ka_swing.ogg",75,math.random(40,45))end;function SWEP:PlayHitSound()self:EmitSound(")weapons/zs_katana/zs_ka_hit.ogg",75,math.random(56,57),1,CHAN_WEAPON)self:EmitSound(")physics/metal/metal_canister_impact_hard"..math.random(3)..".wav",75,math.Rand(60,70),1,CHAN_WEAPON+39)end;function SWEP:PlayHitFleshSound()self:EmitSound(")nox/sword_hit.ogg",75,120,1,CHAN_WEAPON+2)end;function SWEP:OnZombieKilled(w,x,y)if y then return end;local z=self:GetOwner()if z:IsValid()then local s="weapon_zs_f_offal"if not z:HasWeapon(s)then local q=z:GiveWithoutSwitch(s)q.MaxStacks=self.MaxOffal else local q=z:GetWeapon(s)q:SetOffals(math.min(self.MaxOffal,q:GetOffals()+1))q.MaxStacks=self.MaxOffal end end end
