",skin=0,bodygroup={}}}end;SWEP.Base="weapon_zs_basemelee"DEFINE_BASECLASS("weapon_zs_basemelee")SWEP.HoldType="shotgun"SWEP.DamageType=DMG_SLASH;SWEP.ViewModel="models/weapons/c_sledgehammer/c_sledgehammer.mdl"SWEP.WorldModel="models/weapons/w_crowbar.mdl"SWEP.UseHands=true;SWEP.MeleeDamage=167;SWEP.MeleeRange=96;SWEP.MeleeSize=0.8;SWEP.Primary.Delay=1.1;SWEP.Tier=6;SWEP.WalkSpeed=SPEED_SLOW;SWEP.SwingRotation=Angle(0,-10,0)SWEP.SwingRotation2=Angle(-2,-15,4)SWEP.SwingRotation3=Angle(-4,-5,2)SWEP.SwingOffset=Vector(20,-40,-0)SWEP.SwingTime=0.56;SWEP.SwingHoldType="shotgun"SWEP.Stability=WEAPON_STABILITY_WEAK;SWEP.BlockReduction=WEAPON_BLOCK_REDUCTION_STRONG;SWEP.StartSwingAnimation=ACT_VM_HAULBACK;SWEP.HitAnim=ACT_VM_HITKILL;SWEP.MissAnim=ACT_VM_HITKILL;SWEP.BashAnim=ACT_VM_PRIMARYATTACK;SWEP.BlockRotation=Angle(-5,40,-70)SWEP.BlockOffset=Vector(-6,14,3)SWEP.SwingRotation=Angle()SWEP.SwingOffset=Vector(0,0,0)SWEP.AllowQualityWeapons=true;SWEP.StaminaUsage=0.075;SWEP.Cleave=true;SWEP.CleaveTaper=0.3;SWEP.CarveChance=1;SWEP.WeaponBuildup={Colour={195,215,215,255},Name="Cleaves",NameFull="RELOAD: Wind Shear",Requirement=60}GAMEMODE:AttachWeaponModifier(WEAPON_MODIFIER_MELEE_RANGE,4,1)GAMEMODE:AttachWeaponModifier(WEAPON_MODIFIER_MELEE_IMPACT_DELAY,-0.05,1)function SWEP:PlaySwingSound()self:EmitSound("weapons/iceaxe/iceaxe_swing1.wav",75,math.random(65,70),0.75,CHAN_WEAPON+20)self:EmitSound("weapons/zs_katana/zs_ka_swing.ogg",75,math.random(130,150),0.75,CHAN_WEAPON+21)end;function SWEP:PlayHitSound()self:EmitSound("physics/metal/metal_sheet_impact_bullet"..math.random(2)..".wav",70,math.random(90,95),0.8,CHAN_WEAPON+22)end;function SWEP:PlayHitFleshSound()self:EmitSound("weapons/knife/knife_hit"..math.random(4)..".wav",80,math.random(80,85),0.7,CHAN_WEAPON+22)self:EmitSound("nox/sword_hit.ogg",75,110,0.76,CHAN_WEAPON+23)end;function SWEP:DoMeleeAttackAnim()local a=self:GetOwner()a:AnimRestartGesture(GESTURE_SLOT_ATTACK_AND_RELOAD,ACT_GMOD_GESTURE_MELEE_SHOVE_1HAND,true)a:AnimSetGestureWeight(GESTURE_SLOT_ATTACK_AND_RELOAD,0.5)end;function SWEP:GetSwingEndAdjust()local b=self:GetDTInt(10)local c=b==2 and 0.3 or b==1 and 0.4 or b==0 and 1;return c end;function SWEP:GetNextAttackAdjust()local b=self:GetDTInt(10)local c=b==2 and 0.3 or b==1 and 0.4 or b==0 and 1;return c end;function SWEP:BeforeSwing(d)local b=self:GetDTInt(10)if b>=1 then self.HitAnim=ACT_VM_HITKILL;self.MissAnim=ACT_VM_HITKILL;self.HitSequence=nil;self.MissSequence=nil;self.FireAnimSpeed=1 elseif b==0 then self.HitSequence="misscenter1"self.MissSequence="misscenter1"self.FireAnimSpeed=1.5 end;if b==2 then d=d*1.15 end;return d end;function SWEP:AfterSwingPreStamina()local b=self:GetDTInt(10)self.SwingRotation=b==0 and self.SwingRotation or b==1 and self.SwingRotation2 or b>=2 and self.SwingRotation3;self.SwingOffset=b==0 and self.SwingOffset or b==1 and self.SwingOffset or b>=2 and self.SwingOffset;self:SetDTInt(10,b>=2 and 0 or b+1)end;function SWEP:PostOnMeleeHit(e,f,g)if SERVER and e:IsValidLivingZombie()then local a=self:GetOwner()local b=self:GetDTInt(10)if b>=1 then e:AddSerrateStacks(1,a,self)return end;local h=1+(self.CarveChance-1>math.Rand(0,1)and 1 or 0)e:ApplyCarveStacks(h,a,self,7)end end;if SERVER then function SWEP:OnMeleeHit(e,f,g,i)if e:IsValid()and e:IsPlayer()and i>=1 then self:AddWeaponBuildup((self:IsHeavy()and 12.5 or 7.5)/(i+1))end end end;function SWEP:Reload()if not self:CanPrimaryAttack()then return end;self:TriggerWeaponBuildup()end;function SWEP:OnWeaponBuildupUse()local a=self:GetOwner()if SERVER then local j=self:ShootProjectile(self.MeleeDamage*1.75,0,"projectile_charge_forcewave",1000)j.Gravity=0;j.DoOnceHit=function()if not IsValid(a)then return end;a:GiveStack("buff_stack_fervor")end end;local k=a:GetMeleeSpeedMul()self:SendWeaponAnim(self.HitAnim)self:SetNextPrimaryFire(CurTime()+self.Primary.Delay*k*0.5)end
