AddCSLuaFile()SWEP.PrintName="Nuclear Terror"SWEP.Base="weapon_zs_zombie"DEFINE_BASECLASS("weapon_zs_zombie")SWEP.MeleeDamage=40;SWEP.MeleeDamageVsProps=50;SWEP.SlowDownScale=0;SWEP.Primary.Delay=1;SWEP.OverrideSlow=0;SWEP.AlertDelay=3.5;SWEP.Attacks=0;SWEP.LesserEvil=true;SWEP.MeleeDamagePoisonMul=0.5;SWEP.PropDamageBuildup=0;SWEP.PropDamageBuildupPerHit=2;SWEP.LastPropHit=nil;SWEP.LastPropHitTime=nil;function SWEP:Initialize()if CLIENT then self:AttackDisplaysInit()end;BaseClass.Initialize(self)self.DieTime=CurTime()+180 end;function SWEP:Think()BaseClass.Think(self)local a=self:GetOwner()if self.DieTime<=CurTime()then a:Kill()end end;function SWEP:Reload()self:SecondaryAttack()end;function SWEP:MeleeHit(b,c,d,e)local f=CurTime()if not b:IsPlayer()then d=self.MeleeDamageVsProps;if SERVER and b:IsNailed()then local a=self:GetOwner()b.MarkedProp=f+6;b.MarkedPropApplier=a;for g,b in pairs(ents.FindByClass("env_propmark"))do if b:IsValid()and b:GetOwner()==a then b:Remove()end end;local h=ents.Create("env_propmark")if h:IsValid()then h:Spawn()h:SetOwner(a)h:AttachTo(b)h:Fire("kill","",6)end;if self.LastPropHitTime and self.LastPropHitTime+5>f then if self.LastPropHit==b then self.PropDamageBuildup=self.PropDamageBuildup+self.PropDamageBuildupPerHit else self.PropDamageBuildup=0;self.LastPropHit=b end else self.PropDamageBuildup=math.max(0,self.PropDamageBuildup-self.PropDamageBuildupPerHit)end;self.LastPropHitTime=CurTime()d=d+self.PropDamageBuildup end end;BaseClass.MeleeHit(self,b,c,d,e)end;function SWEP:PrimaryAttack()if CurTime()<self:GetNextPrimaryFire()then return end;local a=self:GetOwner()local i=a:GetMeleeSpeedMul()self:SetNextPrimaryFire(CurTime()+self.Primary.Delay*i)self:StartSwinging()end;function SWEP:PlayAlertSound()self:GetOwner():EmitSound(")nuclearterror/moan.ogg",100,math.random(95,100))end;SWEP.PlayIdleSound=SWEP.PlayAlertSound;function SWEP:PlayAttackSound()self:EmitSound("npc/antlion_guard/angry"..math.random(3)..".wav",75,math.random(65,70),0.7)self:GetOwner():EmitSound(")nuclearterror/attack"..math.random(4)..".ogg",75,math.random(95,100),1)end;if not CLIENT then return end;local j=Material("evolutions/poison_zombie/wild_poison_zombie_v2")function SWEP:PreDrawViewModel(k)render.ModelMaterialOverride(j)render.SetColorModulation(0.35,0.65,0.25)end;local l=input.LookupBinding("+attack")or"left mouse"local m=input.LookupBinding("+attack2")or"right mouse"local n=input.LookupBinding("+reload")or"reload"local o=input.LookupBinding("+speed")or"left shift"function SWEP:AttackDisplaysInit()self.AttackDisplays={{Name="Nuclear Claws",Description="Sickness and Poison on hit.",KeyName=string.upper(l),ValFunc=function(p,q)return q:GetNextPrimaryFire()end,NoEffects=true,Icon=Material("zombiesurvival/second_wind.png")},{Name="Undying Will",Description="Killing blows will put you on a knockdown state, but they cannot finish you.",Description2="You will automatically die after some time passes. While being knocked down, creates a poisoning pool and acid nova.",ClassSelectionOnly=true,Passive=true,KeyName=Style.Text("PASSIVE"),Icon=Material("zombiesurvival/raise-zombie.png")}}end
