ryFire(CurTime()+self.AlertDelay)self:DoAlert()end;function SWEP:DoAlert()local a=self:GetOwner()if math.random(2)==1 then a:EmitSound(")vo/ravenholm/monk_rant0"..math.random(1,9)..".wav",75,100,0.5,CHAN_USER_BASE+139)else a:EmitSound(")vo/ravenholm/monk_rant1"..math.random(0,9)..".wav",75,100,0.5,CHAN_USER_BASE+139)end end
