SWEP.PrintName="Rune Watcher"SWEP.Base="weapon_zs_zombie"SWEP.WorldModel="models/crow.mdl"DEFINE_BASECLASS("weapon_zs_zombie")SWEP.IsCrow=true;SWEP.Primary.Delay=6;SWEP.MeleeDelay=0.2;SWEP.RuneFlightDuration=8;SWEP.Secondary.Delay=6;SWEP.DiveDuration=1;SWEP.Damage=10;SWEP.DamageWounds=20;SWEP.MeleeSize=8;SWEP.OverrideSlow=0;AccessorFuncDT(SWEP,"NextVisibility","Float",15)function SWEP:Initialize()if CLIENT then self:SCKInit()self:AttackDisplaysInit()end;if SERVER then self.Touched={}end end;function SWEP:PrimaryAttack()local a=self:GetOwner()if CurTime()<self:GetNextPrimaryFire()or a:IsFrozen()then return end;self:SetDiving(true)self:SetNextPrimaryFire(CurTime()+self.Primary.Delay*a:GetMeleeSpeedMul())self:SetDiveTime(CurTime()+self.DiveDuration)local b=string.format("npc/crow/alert%d.wav",math.random(2,3))local c=math.random(70,75)for d=1,4 do timer.Simple(0.03*d,function()if a:IsValid()then a:EmitSound(b,ZOMBIE_MOAN_ATTEN,c+d*4,0.9,CHAN_AUTO)end end)end;self:SetNextVisibility(CurTime()+4)end;function SWEP:OnRemove()self.Removing=true;local a=self:GetOwner()if a and a:IsValid()then a:ResetJumpPower()end;BaseClass.OnRemove(self)end;function SWEP:PlayAttackSound()self:EmitSound("npc/crow/crow"..math.random(2,3)..".wav",85,75)end;function SWEP:CanSecondaryAttack()return self:GetNextFlight()<=CurTime()end;function SWEP:CanGrab()return self:GetNextGrab()<CurTime()and not self:GetOwner():OnGround()end;function SWEP:FinishGrab(e)local a=self:GetOwner()e.GrabGrace=CurTime()+5;if SERVER then local f=e:GiveStatus("runewatcher_grab",e:Team()==TEAM_UNDEAD and 5 or 2.5,nil,nil,nil,true)f:SetApplier(a)self.GrabStatus=f;self:SetGrabbing(true)if e:Team()==TEAM_HUMAN then e:AddBleedDamage(5,a)end end;a:EmitSound("NPC_Crow.Squawk",75,100,1,CHAN_VOICE)end;function SWEP:CancelGrab()if self.GrabStatus and self.GrabStatus:IsValid()then self.GrabStatus:SetDie(-1)self.GrabStatus:Remove()self.ViewingAngles=nil end end;function SWEP:GrabEnd()self.ViewingAngles=nil;self:SetNextGrab(CurTime()