AN_USER_BASE+i)end end)end end end;function SWEP:PlayPukingSound()self:EmitSound(")npc/barnacle/barnacle_die2.wav",self.IdleAtten,100,self.IdleVolume,CHAN_USER_BASE+20)self:EmitSound(")npc/barnacle/barnacle_digesting1.wav",self.IdleAtten,100,self.IdleVolume,CHAN_USER_BASE+2)self:EmitSound(")npc/barnacle/barnacle_digesting2.wav",self.IdleAtten,100,self.IdleVolume,CHAN_USER_BASE+3)end;function SWEP:StartPukingSound()self:EmitSound(string.format(")physics/body/body_medium_break%d.wav",math.random(2,4)),self.HitAtten,math.random(70,83),self.HitVolume,CHAN_WEAPON)self:EmitSound(string.format(")npc/ichthyosaur/attack_growl%d.wav",math.random(3)),self.HitAtten,math.random(100,120),self.HitVolume,CHAN_WEAPON+20)end;function SWEP:SecondaryAttack()local g=self:GetOwner()if CurTime()<self:GetNextPrimaryFire()or CurTime()<self:GetNextSecondaryFire()or IsValid(g.FeignDeath)then return end;local j=g:GetMeleeSpeedMul()self:SetNextSecondaryFire(CurTime()+self.Secondary.Delay*j*(1+g:GetModVal("ability_cooldown")))self:SetNextPrimaryFire(CurTime()+self.Primary.Delay*j)self:SetNextAlternateAbility(math.max(CurTime()+self.Primary.Delay*j,self:NextAlternateAbility()))g:DoReloadEvent()self:StartPukingSound()if not g:HasSkillMod("second_wind_remove_on_swing")then self:EndSecondWind()end;if SERVER then self:SetGunking(CurTime()+0.3+self.PukeAmount*self.PukeTickRate)timer.Simple(0.3,function()if self:IsValid()then self:SetPukeLeft(self.PukeAmount)self:EndSecondWind()if g:IsValidLivingZombie()then self:PlayPukingSound()end end end)end end
