nsumeBuildup()end end;function SWEP:ShootBullets(o,p,q,c)if c then self.Pens=5;self.Recoil=1 end;BaseClass.ShootBullets(self,o,p,q)self.Recoil=0;self.Pens=nil end;function SWEP:EmitFireSound(c)self:EmitSound(self.Primary.Sound,GUN_ATTEN,math.Rand(97,103),GUN_VOLUME)if c then self:EmitSound(")weapons/deagle/deagle-1.wav",75,math.random(71,75),0.6,CHAN_WEAPON+21)self:EmitSound(")weapons/galil/galil-1.wav",75,math.random(132,138),0.5,CHAN_WEAPON+20)end end
